INSERT INTO board VALUES (1,'2005-01-13 22:12:24','Doufm, e pihlaovn dt na Paneku je celkem jasn. Pokud njakm nedopatenm v potomek v seznamu len chyb nebo jej nemete pihlsit, napite mi na <a href=\"mailto:jan.hanus@gmail.com\">jan.hanus@gmail.com</a>, nebo zavolejte. V dnm ppad jej ale prosm nepihlaujte jako nelena, zpsobte tm vc kody ne uitku. \r\nDky Jenk','Pihlaovn dt',1,2,8);
INSERT INTO board VALUES (9,'2005-01-10 10:00:18','Po ne pli pozitivnch zkuenostech s mnostvm nelen na Silvestru jsme se dohodli, e maximln poet nelen na dan den bude <b>15!</b>. V systmu to zatm nen nijak automaticky oeteno, ale nebojte se, budeme to sledovat:-)','Omezen mnostv nelen',1,5,8);
INSERT INTO board VALUES (10,'2006-11-01 18:28:37','P O Z V  N           \r\n\r\nna lenskou schzi LK Kladno, kter se kon v ter 17. 5. 2005 v 18 hodin v budov Gymnzia v Kladn.       \r\n\r\nProgram : l. Zprva o innosti  zhodnocen sezony\r\n          2. drba chaty.\r\n          3. Upesnn pravidel pihlaovn k pobytu na            Panence.\r\n          4. Placen klub. pspvk a financovn brigd.\r\n          5. Diskuse.\r\n          6. Usnesen.  \r\n\r\n\r\n                                                 Srden zve vbor LK\r\n\r\nPRCE NA CHAT PANENKA\r\n\r\n\r\n\r\n	Natt stechu \r\n	Dokonit zateplen chaty\r\n	Zrevidovat a opravit komny a kamna\r\n	Sloit dv a uhl\r\n	Posekn a shrabn trvy\r\n	Obnova dve ( zmky, kliky ) a reijn drba chaty\r\n	Vmna hasicch pstroj\r\n\r\n','Valn hromada LK',1,5,35);
INSERT INTO board VALUES (6,'2005-08-25 07:05:37','<html>\r\n<head>\r\n<meta content=\"text/html; charset=ISO-1250\"\r\nhttp-equiv=\"content-type\">\r\n<title>Schze vbor 24.8.2005</title>\r\n</head>\r\n<body>\r\n<big><span style=\"font-weight: bold;\"></span></big>\r\n<big style=\"font-weight: bold;\"><small><br>\r\n</small></big>\r\n<ul>\r\n<li><big style=\"font-weight: bold;\"><small>Schze vbor 24.5.2005 - Zpis</small></big><br>\r\n<div style=\"text-align: justify;\">\r\n<br>1) Seznmeni s dopisem o ly, vl. - dohodnuto zruen vleku v obdob 3-5 let. Bude reagovat Petr .\r\n<br>2) Jednalo se o stavu projektu istiky. Nklady 10000-15000K s provdkou a zastupovanm na adech.\r\n<br>3) Rozvaha nad asovm rozvrhem investic.\r\n<br>    Byl odsouhlasem nakup potebnch vc.\r\n<br>4) Odloen nkup krbovch kamen do spol mstnosti. Nebezpe znien uhlm.\r\n<br>5) J. Kohout 2 a 3 tden v lednu.\r\n<br>6) Brigda uhl 24-25.9.2005 (resp. 1-2.10.2005).\r\n<br>7) Pejednno co jet do konce roku za prce - dal schze\r\n<br> \r\nPedbn stanoven termn dal schze na TER 6.9.2005 v 18:00 v restauraci esk Lpa.\r\n<br> \r\n<br></br>\r\nPetr Kolouch ml.\r\n<br></br>\r\n</ul>\r\n</body>\r\n</html>','Zpis ze schze 24.8.2005',1,3,35);
INSERT INTO board VALUES (5,'2005-08-25 06:44:07','<html>\r\n<head>\r\n<meta content=\"text/html; charset=ISO-1250\"\r\nhttp-equiv=\"content-type\">\r\n<title>Schze len</title>\r\n</head>\r\n<body>\r\n<big><span style=\"font-weight: bold;\"></span></big>\r\n<big style=\"font-weight: bold;\"><small><br>\r\n</small></big>\r\n<ul>\r\n<li><big style=\"font-weight: bold;\"><small>Zpis ze schze len 17.5.2005</small></big><br>\r\n<div style=\"text-align: justify;\">\r\n<br>1) Jindra sojka si bere na starost komny a hasic pstroje.\r\n<br>2) Internetem se bude mon pihlaovat na tdny (nejen na vkendy).\r\n<br>3) Smazn strnek na CVUT.\r\n<br>4) Kamard 130k.\r\n<br>5) Thotn a dlohodob nemocn jen 400k pspvek a na chatu za lenskou cenu.\r\n<br>6) J. Kohout nedostane nor.\r\n<br>Pedbn stanoven termn dal schze na srpen v 18:00 v restauraci esk Lpa.br\r\n<br></br>\r\nPetr Kolouch ml.\r\n<br></br>\r\n</ul>\r\n</body>\r\n</html>','Schze len',1,3,35);
INSERT INTO board VALUES (4,'2006-11-01 18:28:15','Ahoj lyai,\r\no vkendu 30.9-2.10 2005 je brigda na sloen uhl. Potvrte svou ast \r\nna email Zdnka Beky beky66@volny.cz nebo na mobiln telefon 605419964. Kdo m\r\nmonost automobilu, a mi nahls koho poveze -poppad volnou kapacitu\r\nvozu.\r\nProsm informujte leny rodiny a vechny leny LK, na kter mte kontakt. \r\nNen v mch silch upln vechny obvolat a je opravdu nejvy as, aby uhl\r\nbylo v chalup.\r\n\r\n//PS: Je to ideln monost jak sv, po ltu ztuhl, tlo rozhbat ped\r\nnastvajc lyaskou sezonou a zrove se pipravit na typicky esk horsk \r\nvzduch. :-)\r\n\r\nDky\r\nPetr Kolouch Mobil: +420731162843\r\n','!!! V ptek 30.9.2005 bude brigda na uhl. !!!',1,5,35);
