INSERT INTO board VALUES (85,'2008-08-26 13:07:38','</head>\r\n\r\n<body lang=CS link=blue vlink=purple>\r\n\r\n<div class=Section1>\r\n\r\n<p class=MsoNormal>Ahoj lyai,</p>\r\n\r\n<p class=MsoNormal>poslm termny nutnch brigd.</p>\r\n\r\n<p class=MsoNormal>&nbsp;</p>\r\n\r\n<p class=MsoNormal>13-14. z &nbsp;sten likvidace vleku a pprava pro\r\nuhl/devo. Hlaste se u Petr Kolouch ml. 731162843 <a\r\nhref=\"mailto:kolouch.petr@colaut.cz\">kolouch.petr@colaut.cz</a></p>\r\n\r\n<p class=MsoNormal><span lang=EN-US>27-28. </span>z (termn nen 100<span\r\nlang=EN-US>%</span>) likvidace vleku a pprava na uhl/devo a likvidace\r\nvleku. Hlaste se u Tom Beka 605802125 <a href=\"mailto:tbecka@celestica.com\">tbecka@celestica.com</a></p>\r\n\r\n<p class=MsoNormal>4-5. jen Uhl, devo, likvidace vleku a pprava na\r\nseznu. Hlaste se u Zdenk Beka&nbsp; 605419964 <a\r\nhref=\"mailto:beky66@seznam.cz\">beky66@seznam.cz</a></p>\r\n\r\n<p class=MsoNormal>&nbsp;</p>\r\n\r\n<p class=MsoNormal>Ppadn dal informace na nstnce na <a\r\nhref=\"http://www.lk-panenka.cz\">www.lk-panenka.cz</a> </p>\r\n\r\n<p class=MsoNormal>&nbsp;</p>\r\n\r\n<p class=MsoNormal>Potvrte svou ast co nejdve<span lang=EN-US>!</span></p>\r\n\r\n<p class=MsoNormal>Za vbor Petr Kolouch</p>\r\n\r\n<p class=MsoNormal>&nbsp;</p>\r\n\r\n</div>\r\n\r\n</body>\r\n\r\n</html>','Brigdy 2008',1,1,35);
INSERT INTO board VALUES (78,'2007-12-04 21:37:09','<body>\r\n<p>1) Jednohlasn odsouhlasen program schze.<br>\r\n2) Pednesena zvodn innost H.Hanuem a tmatu zvod na kolech.<br>\r\n3) Pedneseny vsledky hospodaen a finann situace LK.<br>\r\n4) Vbor doplnn o Petru Strakovou (Laurencovou).<br>\r\n5) Jindich Sojka se ujme likvidace vleku Panenka.<br>\r\n6) Mezi bnmi koly brigd byl pednesen lenm stav ntru stechy. Stecha \r\nme bt natena vybranou firmou.<br>\r\n7) Na skky se v zimn sezn umst jejich sla a popisov pole tak, aby \r\nmajitel mohli doplnit sv jmna.</p>\r\n<p>Sepsal: Petr Kolouch ml.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n\r\n\r\n\r\n\r\n</body>\r\n','Zpis ze schze len LK',1,2,35);
INSERT INTO board VALUES (15,'2005-12-13 08:10:09','<html>\r\n<body>\r\n<p class=\"MsoNormal\" style=\"margin-top:0; margin-bottom:0\" align=\"justify\">\r\nNa schzi len 29.11.2005 bylo odsouhlaseno: </p>\r\n<p class=\"MsoNormal\" style=\"margin-top:0; margin-bottom:0\" align=\"justify\">\r\n&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"margin-top:0; margin-bottom:0\">\r\n<font face=\"Arial\"><b>Thotn a len na matesk maj automaticky odpracovanou \r\njednu brigdu.&nbsp; </b><br>\r\n</font>Pravidlo vstupuje v platnost dnem schze (29.11.2005).</p>\r\n</body>\r\n</html>','Nov pravidlo.',1,2,35);
INSERT INTO board VALUES (16,'2005-12-13 06:30:35','<html>\r\n\r\n<head>\r\n<meta name=\"GENERATOR\" content=\"Microsoft FrontPage 5.0\">\r\n<meta name=\"ProgId\" content=\"FrontPage.Editor.Document\">\r\n<meta http-equiv=\"Content-Type\" content=\"text/html; charset=windows-1250\">\r\n<title>Dohodnuto a odsouhlaseno na schzi len 29.11.2005</title>\r\n<style>\r\n<!--\r\n p.MsoNormal\r\n	{mso-style-parent:\"\";\r\n	margin-bottom:.0001pt;\r\n	font-size:12.0pt;\r\n	font-family:\"Times New Roman\";\r\n	margin-left:0cm; margin-right:0cm; margin-top:0cm}\r\n-->\r\n</style>\r\n</head>\r\n\r\n<body>\r\n\r\n<p class=\"MsoNormal\"><b><font face=\"Arial\">Dohodnuto a odsouhlaseno na schzi len 29.11.2005</font></b></p>\r\n<p class=\"MsoNormal\" style=\"text-indent: -141.6pt; margin-left: 141.6pt\">&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"text-indent: -141.6pt; margin-left: 141.6pt\">1. \r\nDleit termny:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; lenov maj pi pihlaovn na vkend a \r\nnsledujc tden pednost&nbsp; ped kamardy do stedy do 24:00. Na Vnoce a Jarn \r\nprzdniny maj lenov pednost ped kamardy do 10. 12. 2005 do 24:00 resp. do \r\n16. 2. 2006 opt do 24:00 V&nbsp;ppad, e nebude moci na Panenku jet, odhlaujte \r\nse, prosm, co nejdve. </p>\r\n<p class=\"MsoNormal\" style=\"text-indent: -141.6pt; margin-left: 141.6pt\">2. \r\nPihlaovn kamard:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Kamardy je mono pihlaovat maximln do potu \r\n40 lid na chalup nebo jej kapacity, je-li na dan termn ni. Na pedem \r\nzamluven tdny je mon pihlsit kamardy jen po dohod s&nbsp;vedoucm tdne. \r\nKadopdn stle plat termny dan v&nbsp;bodu 1. Jeden len me s&nbsp;sebou vzt na \r\nPanenku maximln 2 kamardy, na Vnoce jen jednoho. O udlen ppadn vjimky \r\nje nutn podat s&nbsp;dostatenm pedstihem vbor LK. </p>\r\n<p class=\"MsoNormal\" style=\"text-indent: -141.6pt; margin-left: 141.6pt\">3. \r\nOmezen kapacity:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Z&nbsp;dvodu nemrnho zaten chalupy se vbor \r\nLK usnesl snit kapacitu chalupy pe tden na 35 mst, resp. 40 na Jarn \r\nprzdniny. Na vkendy zstv kapacita 50 mst. V&nbsp;pravomoci vedoucho zjezdu je \r\nkapacitu bhem tdne zvit nad udvan limit. </p>\r\n<p class=\"MsoNormal\" style=\"text-indent: -141.6pt; margin-left: 141.6pt\">4. \r\nZamlouvn tdn:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Na leton seznu si ji nelze zamluvit tden, \r\npravidla pro zamlouvn tdn na pt seznu budou uveejnna na jae.</p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<p class=\"MsoNormal\">Vysvtlujc pklady k&nbsp;pihlaovn:</p>\r\n<p class=\"MsoNormal\">Pokud si len v&nbsp;pondl pihls na vkend dva kamardy a \r\ndo stedy do plnoci se pihls 40 dalch len (nebo se napln kapacita \r\nchalupy je-li na dan termn ni), kamardi bohuel na Panenku jet nemohou.\r\n</p>\r\n<p class=\"MsoNormal\">Pokud ve stedu o plnoci bude na Panenku pihleno 40 \r\nlid vetn kamard, ji nejde dal kamardy pihlaovat. lenov se vak \r\nmohou pihlaovat i nadle a do naplnn kapacity vypsan na dan termn.</p>\r\n<p class=\"MsoNormal\">V&nbsp;ppad snen kapacity pod 40 mst je mon od \r\nsteden plnoci pihlaovat kamardy se stejnou prioritou jako leny. </p>\r\n\r\n</body>\r\n\r\n</html>','Pravidla pihlaovn na chatu Panenka',1,2,35);
