INSERT INTO board VALUES (80,'2008-01-30 14:19:28','Omluvte prosim docasnou nedostupnost mesice unora, ktera se stava maximalne jednou za 4 roky (ano spravne je prestupny rok, na coz jsem pri psani kalendare zapomel).\r\n\r\nChyba bude napravena hned zitra, tedy 31.1.\r\n\r\nJirka Stepan','Chyba rezervaci',1,1,90);
INSERT INTO board VALUES (82,'2008-03-31 10:29:22','Ven,<br>\r\njak ji bylo naznaeno na podzimn valn hromad, v letonm roce jsme se rozhodli uspodat cyklistick zvody. Cel akce m ji velmi konkrtn obrysy - zvody se budou konat na Doksech <b>v nedli 18.5.</b> od 9 do cca 15 hod. Prosil bych vs kdo budete mt as a chu o pomoc. Jednak v den podn zvod, ale tak v sobotu odpoledne ped zvody. Vae pomoc pot bude zohlednna pi zapotvn brigd. <br>\r\nPropozice k zvodm najdete na http://jiri.etnetera.cz/miniliga/ . <br>\r\nKdo byste byl ochoten pomoc, ozvte se mi prosim mailem (jan.hanus@gmail.com) nebo na tel. 777557639<br>\r\nZa vai ochotu pomoc pedem dkuji.<br>\r\nHonza Hanu','Padme MTB zvody',1,1,22);
INSERT INTO board VALUES (17,'2006-11-01 18:27:03','<html>\r\n\r\n<head>\r\n<meta name=\"GENERATOR\" content=\"Microsoft FrontPage 5.0\">\r\n<meta name=\"ProgId\" content=\"FrontPage.Editor.Document\">\r\n<meta http-equiv=\"Content-Type\" content=\"text/html; charset=windows-1250\">\r\n<title>Dohodnuto a odsouhlaseno na schzi len 29.11.2005</title>\r\n</head>\r\n<body>\r\n<p class=\"MsoNormal\" style=\"margin-top:0; margin-bottom:0\" align=\"justify\">\r\nNa schzi len 29.11.2005 bylo odhlasovno (pro/proti 20/8) nov pravidlo.</p>\r\n<p class=\"MsoNormal\" style=\"margin-top:0; margin-bottom:0\" align=\"justify\">\r\n&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"margin-top:0; margin-bottom:0\" align=\"justify\">\r\n<b>Ten kdo nem za dva roky \r\nzptn brigdu bude platit za pobyt 50 K/den.</b></p>\r\n<p class=\"MsoNormal\" style=\"margin-top:0; margin-bottom:0\">\r\nPravidlo vstupuje v platnost dnem schze (29.11.2005) a vztahuje se zptn i na \r\nroky 2004 a 2005.</p>\r\n<p class=\"MsoNormal\" style=\"margin-top:0; margin-bottom:0\">\r\n&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"margin-top:0; margin-bottom:0\">\r\n<i><font size=\"2\">V kuchyni bude vyven seznam asti na brigdch v dotench \r\nletech, aby bylo jasn na koho se tato prava tk.</font></i></p>\r\n<p class=\"MsoNormal\" style=\"margin-top:0; margin-bottom:0\">&nbsp;</p>\r\n\r\n</body>\r\n\r\n</html>','Pozor! Zmna v placen pobytu len na chat panenka.',1,2,35);
