INSERT INTO board VALUES (19,'2005-12-13 07:56:35','<html>\r\n\r\n\r\n<meta http-equiv=\"Content-Language\" content=\"cs\">\r\n<p><font face=\"Arial\"><b>Program: </b></font></p>\r\n<ol>\r\n  <li><font face=\"Arial\">zahjen (Prochzka),</font></li>\r\n  <li><font face=\"Arial\">hospodaen (Z. Beka),</font></li>\r\n  <li><font face=\"Arial\">zvodn innost (Hanu),</font></li>\r\n  <li><font face=\"Arial\">brigdy (Laurenc),</font></li>\r\n  <li><font face=\"Arial\">termnov listina (Prochzka),</font></li>\r\n  <li><font face=\"Arial\">pravidla pihlaovn (Hanu),</font></li>\r\n  <li><font face=\"Arial\">diskuze,</font></li>\r\n  <li><font face=\"Arial\">usnesen,</font></li>\r\n  <li><font face=\"Arial\">zvr,</font></li>\r\n</ol>\r\n<p><font face=\"Arial\">k 1. --- <br>\r\nk 2. Pednesena zprva o hospodaen.&nbsp; <br>\r\nk 3. Koupeny znmky od Svazu Lya, podporujeme zvodn innost, pispvme na \r\ndopravu a startovn zvodnka. <br>\r\nk 4. Zhodnocen brigd, bude se ruit vlek (nikdo nic nenamtal), sekn trvy.\r\n<br>\r\nk 5. ---<br>\r\nk 6. Pedneseny pravidla pihlaovn a placen.&nbsp;&nbsp;&nbsp; <br>\r\nk 7. Diskuze:<br>\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - \r\ndotace sttu na seen trvy - zjist Kratochvl,<br>\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - \r\norganizace vedoucch na tdny / Kohout kola, <br>\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - \r\nnavreno: Ten kdo nem za dva roky zptn brigdu bude platit za pobyt 50 \r\nK/den.<br>\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; \r\n- Z.Beka obava z nvalu na brigdy (pro nkoho nen prce),<br>\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; \r\n- Sojka chce, aby se platilo vce,<br>\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; \r\n- bude platit i zptn pro roky 2004 a 2005,<br>\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - netsn \r\nokna bude se eit na jarn schzi,<br>\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - thotn a len na\r\nmatesk maj automaticky odpracovanou jednu brigdu (schvleno platnost od ??? ).&nbsp; <br>\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; - pravidla \r\npihlaovn dt na internet.<br>\r\nk 8. odhlasovno (pro/proti 20/8) nov pravidlo<b>: </b>\r\nTen kdo nem za dva roky zptn brigdu bude platit za pobyt 50 K/den. Pravidlo \r\nvstupuje v platnost dnem schze (29.11.2005) a vztahuje se zptn i na roky 2004 \r\na 2005.<br>\r\nk 9. ---</font></p>\r\n\r\n</html>','Zpis ze schze 29.11.2005',1,3,35);
