INSERT INTO board VALUES (24,'2005-11-07 09:37:25','1) STV m penze ze 95% Sazka, 5% (Krkonoe, Zadar, atd..).\r\nPostavenm Sazka Arny Sazka nem Sazka penze plat obligace a navc nov plat DPH. STV m o 19% (DPH mn) a zatim jen 65% slben stky. Tyto penze dostavem na uet. Mon dostanem jet pak doplatek do 80%, ale to bude max a ned se na to spolehnout. Nad 80% procent je to to DPH.\r\n- kalkulaci ped Kolouch na schzi<br>\r\n2) do 15.1.2006 musme aktualizovat lenskou zkladnu a informace o klubu (registrace na ministerstvu ICO DIC adresa, kontaktn osoby)a nemovitostech (pasportizace) na STV (elektronicky) jinak pdem o pispvky na dal rok.<br>\r\n3) Software je na www.cstv.cz (pejmenovat na EXE) a data do nj pole cstvkl@quick.cz.\r\nData novelizovat a poslat zpt na cstvkl@quick.cz. <br>\r\n4) od 1.7.2007 povinost pdovojn uetnictv <br>\r\n5) Hospodi klub budou koleni na ABRA systm hospodaen na stv Kladno. Pihlsit se na terminy listopad, prosinec, leden. Jeto zdarma. Dobr je dlat podvojn od 1.1.2006 by se to hospod nauil. - Nevm jestli je to nutn <br>\r\n6) STV a Kladnensk denk zasteuji akci sportuj s nmi. Kluby mohou uspodat veejnou sportovn akci a STV zaplat   Kladnensk denk -  Hospodi klub budou koleni na ABRA systm hospodaen na stv Kladno. Pihlsit se na terminy listopad, prosinec, leden. Jeto zdarma. Dobr je dlat podvojn od 1.1.2006 by se to hospod nauil. - Nevm jestli je to nutn <br>\r\n\r\nKolouch \r\n','Schze STV - Kokos 1.11.2005',1,3,35);
INSERT INTO board VALUES (20,'2005-12-02 15:04:14','---Projednn program schze len----\r\nProgram schze 29.11.2005:<br>\r\nOd 17:45 administrativa, zatek 18:00  <br>\r\n1)	zahjen,(Pavel)<br>\r\n2)	hospodaen,(Zdenk)<br>\r\n3)	zvodn innost,(Honza)<br>\r\n4)	brigdy,(Ota)<br>\r\n5)	termnov listina,(Pavel)<br>\r\n6)	pravidla pihlaovn,(Honza/J.tpn)<br>\r\n7)	doplnn vboru,(Pavel)<br>\r\n8)	usnesen,<br>\r\n9)	zvr.<br>\r\n <br>\r\nKontakty lon: Tom,Zdenk<br>\r\nTermnovka: Pavel<br>\r\nSeznamy len prezence atd: Zdenk<br>\r\n<br>\r\nDale navrhnout:<br>\r\n1) Kdo nem dva roky brigdu....<br>\r\n2) Sponzorov maj vhody....<br>\r\n3) Thotn, na matesk a nemocn (dlouhodob) maj automaticky jednu brigdu hotovou.<br>\r\n   \r\n---------------------------------------<br>\r\n <br>\r\n','Zpis ze schze 14.11.2005',1,3,35);
INSERT INTO board VALUES (21,'2005-12-02 15:04:27','Tmto Vs zveme na lenskou schzi Lyaskho klubu Kladno, kter se kon v ter 29.11.2005 v 18:00 hodin v budov Gymnzia v Kladn. <br><br>\r\nProgram schze:<br>\r\n1)	zahjen,<br>\r\n2)	hospodaen,<br>\r\n3)	zvodn innost,<br>\r\n4)	brigdy,<br>\r\n5)	termnov listina,<br>\r\n6)	pravidla pihlaovn,<br>\r\n7)	doplnn vboru,<br>\r\n8)	usnesen,<br>\r\n9)	zvr.<br>\r\n<br>\r\nVybrn lenskch pspvk bude probhat ji od 17:45. <br>\r\n<br>\r\nSrden Vs zve vbor LK\r\n<br>','P r o g r a m  schze 29.11.2005 v 18:00 hodin v budov Gymnzia v Kladn.',1,2,35);
INSERT INTO board VALUES (25,'2005-11-10 08:26:41','1) Ota: dal nov zstny do koupelen, nov sifondo umyvadla, dven ttky. <br>\r\n2) Pivst k darlingu nov nhradn ventlky + pumpiku - dle Oty Zdenk + nov zachodov systm <br>\r\n3) Potvrzen termn 29.11.2005 ter v 18:00 schze lensk zkladny<br>\r\n4) pt rok vyistit boilery <br>\r\n5) Ji tpnek vykonal brigdy tvoenm www strnek panenky<br>\r\n6) Koupit teplomry do koupelen<br>\r\n6) Thotn(), matesk, dlouhodob nemocn - 400 K lensk pispvek.<br>\r\n7) Na S LV navhrnut: -Kdo nebude mt roky brigdu tak plat 50 k/noc. - Vbor mus mt monost lovku kter dal sponzorsk dar, zajistit vkody<br>\r\n8) Vbor se sejde v tdnu 14-20.11.2005 <br>\r\n\r\n\r\n','Zpis ze schze 25.10.2005',1,3,35);
INSERT INTO board VALUES (26,'2005-11-07 07:01:32','1) L. Vlek schvlen KRNAP. Vlek Zlikvidovat do prosince 2007. KRNAP uvedl, e prsek bude zalesnn. <br>\r\n2) Zdenk B. vytiskl termnovku na seznu 2005-2006 <br>\r\n3) Kohout termn v noru a jeden v lednu ped przdnnama (15-20.1 s 8-13.2)<br>\r\n4) Zahajit vrobu dt - nov zvodnci <br>\r\n5) Koupme 4 znmky do svazu lya. 1x dospl a 3x dti<br>\r\n6) Zdenk B. d dohromady seznam kdo m brigdu(y)<br>\r\n7) Navreny termny pro valnou schzi lenu 24 a 29.11.2006<br>\r\n8) Kolouch d dohromady pravidla pihlaovn lenu atd. <br>\r\n9) 200 K pro matku na matesk/rok + na chatu normln jakop len. <br>\r\n10) LV chyb jeden len. <br>\r\n11) Komn palkarna je plnej saz a dvka jsou zazdn. - bude eit Toma <br>\r\n12) Bude brzy znm zvr uzemnho rozhodnut (zen) na istiku odpadnch vod <br>\r\n\r\n\r\n\r\n','Zpis ze schze 8.9.2005',1,3,35);
