INSERT INTO board VALUES (52,'2006-05-31 10:41:45','<body>\r\n\r\n<p class=\"MsoNormal\" style=\"text-indent: -18.0pt; margin-left: 36.0pt\">1)<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span>Mme stavebn povolen na istiku. Problm s&nbsp;vvozem kal dle projektu. \r\nBude se eit pi stavb (asi hovno-cuc u senku).</p>\r\n<p class=\"MsoNormal\" style=\"text-indent: -18.0pt; margin-left: 36.0pt\">2)<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span>Z. Beka zajist na cenn stavby istiky u Uniservis Hasek.</p>\r\n<p class=\"MsoNormal\" style=\"text-indent: -18.0pt; margin-left: 36.0pt\">3)<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span>Brigdy:</p>\r\n<p class=\"MsoNormal\" style=\"text-indent: -18.0pt; margin-left: 72.0pt\">-<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span>stecha (Kratochvl)</p>\r\n<p class=\"MsoNormal\" style=\"text-indent: -18.0pt; margin-left: 72.0pt\">-<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span>dotace na seen trvy (Kratochvl)</p>\r\n<p class=\"MsoNormal\" style=\"text-indent: -18.0pt; margin-left: 72.0pt\">-<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span>vymalovat&nbsp; koupelny desinfekn</p>\r\n<p class=\"MsoNormal\" style=\"text-indent: -18.0pt; margin-left: 72.0pt\">-<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span>Z. Beka vye otzku sekaky a posekn trvy s&nbsp;J. Kohoutem</p>\r\n<p class=\"MsoNormal\" style=\"text-indent: -18.0pt; margin-left: 72.0pt\">-<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span>ukonit opravu kamen a komn (dvek)</p>\r\n<p class=\"MsoNormal\" style=\"text-indent: -18.0pt; margin-left: 72.0pt\">-<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span>Stoly ( dva velk a ti mal) a idle do velkch mstnost (Pardubick, \r\nVebrovka) bez polstrovn,</p>\r\n<p class=\"MsoNormal\" style=\"text-indent: -18.0pt; margin-left: 72.0pt\">-<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span>T. Beka koup ebk na stechu atd. (poadavky na ebk jsou mu jasn)</p>\r\n<p class=\"MsoNormal\" style=\"text-indent: -18.0pt; margin-left: 72.0pt\">-<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span>U postel je nutn obnovit chyty do stropu a podlahy (vingle)</p>\r\n<p class=\"MsoNormal\" style=\"text-indent: -18.0pt; margin-left: 72.0pt\">-<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span>Opravit nutn roty v&nbsp;postelch</p>\r\n<p class=\"MsoNormal\" style=\"text-indent: -18.0pt; margin-left: 72.0pt\">-<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span>Pi rekonstrukci podlah nov pozinkovan plachy v&nbsp;okol kamen.</p>\r\n<p class=\"MsoNormal\" style=\"text-indent: -18.0pt; margin-left: 72.0pt\">-<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span>?? Krbov kamna do spoleensk mstnosti ?? &nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"text-indent: -18.0pt; margin-left: 72.0pt\">-<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span>udlat kontrolu vody .... spojen s&nbsp;akc &nbsp;istika atd..</p>\r\n<p class=\"MsoNormal\" style=\"text-indent: -18.0pt; margin-left: 72.0pt\">-<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span>Stky na komnech  plechov</p>\r\n<p class=\"MsoNormal\" style=\"text-indent: -18.0pt; margin-left: 72.0pt\">-<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span>vyeit paez na lanovku na uhl</p>\r\n<p class=\"MsoNormal\" style=\"text-indent: -18.0pt; margin-left: 72.0pt\">-<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span>Zateplit pokoj Vbrovka  tt</p>\r\n<p class=\"MsoNormal\" style=\"margin-left:18.0pt\">&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"text-indent: -18.0pt; margin-left: 36.0pt\">4)<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span>Termny brigd:</p>\r\n<p class=\"MsoNormal\" style=\"text-indent: -18.0pt; margin-left: 72.0pt\">-<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span>9-11.06 Veobecn brigda</p>\r\n<p class=\"MsoNormal\" style=\"text-indent: -18.0pt; margin-left: 72.0pt\">-<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span>15-17.09 Uhl</p>\r\n<p class=\"MsoNormal\" style=\"text-indent: -18.0pt; margin-left: 72.0pt\">-<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span>7-8.10 klid chaty + do zateplen</p>\r\n<p class=\"MsoNormal\" style=\"text-indent: -18.0pt; margin-left: 72.0pt\">&nbsp;</p>\r\n\r\n</body>\r\n','Zpis ze schze 25.04.2006',1,3,35);
