INSERT INTO board VALUES (55,'2006-11-01 18:25:14','Ven,\r\nzima se bl a bude opt poteba nm topit. Uhl je objednan na ptek 22.9. 06, take se na vs v tomto termnu tme v co nejhojnjm potu. Pokuste se tuto informaci pedat co nejvce lenm, a aspo nkdo doraz. Samozejm se budou dlat i dal drobn prce pro zajitn pichzejc zimn sezony.          Hlate se pes internet jako na pobyt. \r\n','!!!BRIGDA NA UHL!!!  a nejen uhl',1,5,35);
INSERT INTO board VALUES (57,'2006-09-01 06:23:32','Ahoj Honzo, \r\npri cetnosti nasich navstev na chate Panenka a pri podpore zavodniho lyzovani, jake se soucasnym zavodnikum dostava se nam bohate vyplati (pokud bychom chteli na Panenku zajet) si zaplatit neclenskou cenu za noc a netrapit se brigadami ani nicim podobnym. Letos v lete jsme proto vyprazdnili skrinky, odvezli vsechny nase veci a ja i moje manzelka bychom radi pozastavili clenstvi. Protoze takova vec se podle soucasnych stanov udelat neda, zrejme tedy nase clenstvi ukoncujeme. Zvazovali jsme toto rozhodnuti jiz treti sezonu a myslim, ze nema smysl jej dale odkladat, zvlaste kdyz jsme za posledni tri sezony stravili na Panence celkem snad jen dva vikendy. Predej prosim tuto informaci ostatnim clenum vyboru.\r\nPrejeme celemu sdruzeni mnoho stesti do dalsich let ... \r\nStanda\r\n','Standa Rataj',1,3,35);
