INSERT INTO board VALUES (68,'2007-06-07 20:25:30','</head>\r\n\r\n<body lang=CS style=\'tab-interval:35.4pt\'>\r\n\r\n<div class=Section1>\r\n\r\n<p class=MsoNormal>22.6.2006 Brigda. Hlavnm clem je topn devo.</p>\r\n\r\n<p class=MsoNormal>Nad chatou se v&nbsp;tuto chvli nalz 4m<sup>3</sup> deva\r\n(pi 10 lidech na kadho pipadne cca 6 metrovch kld).</p>\r\n\r\n<p class=MsoNormal>Kdo jen trochu mete tak se nahlaste Z. Bekovi, e jedete.\r\nZrove si zjistte obsazen aut.</p>\r\n\r\n<p class=MsoNormal><o:p>&nbsp;</o:p></p>\r\n\r\n<p class=MsoNormal style=\'tab-stops:81.0pt\'>Pidlen koly: Motorov pila  Z.\r\nBeka</p>\r\n\r\n<p class=MsoNormal style=\'tab-stops:81.0pt\'><span style=\'mso-tab-count:1\'> </span><span\r\nclass=SpellE>Kramle</span>, etzy a lana  T. Beka</p>\r\n\r\n<p class=MsoNormal style=\'tab-stops:81.0pt\'><span style=\'mso-tab-count:1\'> </span><span\r\nclass=SpellE>Kovinoez</span>  Z. Beka</p>\r\n\r\n<p class=MsoNormal style=\'tab-stops:81.0pt\'><span style=\'mso-tab-count:1\'> </span>Lepidlo,\r\nvruty atd. na opravu idl  O. <span class=SpellE>Laurenc</span></p>\r\n\r\n<p class=MsoNormal style=\'tab-stops:81.0pt\'><span style=\'mso-tab-count:1\'> </span>ebky\r\n Kolouch</p>\r\n\r\n<p class=MsoNormal style=\'tab-stops:81.0pt\'><o:p>&nbsp;</o:p></p>\r\n\r\n<p class=MsoNormal style=\'tab-stops:81.0pt\'>Dal tmata brigd(y): zateplit <span\r\nclass=SpellE>Vbrovku</span>,</p>\r\n\r\n<p class=MsoNormal style=\'tab-stops:81.0pt\'><span style=\'mso-tab-count:1\'> </span>vysekat\r\nokol chaty,</p>\r\n\r\n<p class=MsoNormal style=\'tab-stops:81.0pt\'><span style=\'mso-tab-count:1\'> </span>dott\r\nstechu,</p>\r\n\r\n<p class=MsoNormal style=\'tab-stops:81.0pt\'><span style=\'mso-tab-count:1\'> </span>zmit\r\nrozmry pro podlahov krytiny do mstnost,</p>\r\n\r\n<p class=MsoNormal style=\'tab-stops:81.0pt\'><span style=\'mso-tab-count:1\'> </span>zajistit\r\nstav <span class=SpellE>lyrny</span> (krakovce),</p>\r\n\r\n<p class=MsoNormal style=\'tab-stops:81.0pt\'><span style=\'mso-tab-count:1\'> </span>renovace\r\nmstnosti u suchch zchod,</p>\r\n\r\n<p class=MsoNormal style=\'tab-stops:81.0pt\'><span style=\'mso-tab-count:1\'> </span>kontrola\r\nvody,</p>\r\n\r\n<p class=MsoNormal style=\'tab-stops:81.0pt\'><span style=\'mso-tab-count:1\'> </span>a\r\ndal... .</p>\r\n\r\n<p class=MsoNormal style=\'tab-stops:81.0pt\'><o:p>&nbsp;</o:p></p>\r\n\r\n</div>\r\n\r\n</body>\r\n\r\n</html>','22.6.2006 Brigda',1,1,35);
INSERT INTO board VALUES (69,'2007-06-11 14:36:17','---------RATAJ----------------------------------------------\r\nAhoj,\r\nsice jsem tuhle skutecnost jiz psal Honzovi Hanusovi asi pred rokem, ale \r\nnevadi - tak tedy jeste jednou.\r\nPanenka je za stavajiciho stavu pri nasich soucasnych casovych \r\nmoznostech, jejim standardnim obsazeni etc. prilis drahou a neprilis \r\nzajimavou rekreaci, zavodni lyzovani tam perspektivu ztratilo jiz davno, \r\ntakze nas prosim nadale nepokladejte za cleny LK Kladno. Konkretne mne a \r\nmou zenu Petru, jak je na tom zbytek klanu Ratajovych nevim.\r\nNase veci ze skrinek jsme vyklidili jiz loni v lete, klicky od vseho \r\nmaji nasi a predpokladam, ze pokud tam zajedou, mohou tak zcela uvolnit \r\nskrinku po me zene a Dane Funcke (drive Chaloupkove), ktera dle mych \r\ninformaci take clenstvi ukoncila.\r\nInformace o brigadach jsou tak na nasi adresu ponekud zbytecne.\r\nAhoj a pekny den.\r\nStanda Rataj\r\n------POSEKANCH---------------------------------------\r\nMl\'s dt vdt dv. Jsme na dovolen v Chorvatsku. Vdt, e plnuje takovouhle\r\n>skvlou pabu, tak jsme nikam nejeli. Tak pt.\r\n>Radek\r\n---------PETR SKLEN----------------------------------\r\nBohuel jsem zatm po plastice vazu o berlch, tohle je na m moc brzo\r\nPetr \r\nAhoj,\r\n-----------------Eva Koutn-Ratajov--------------------\r\nz duvodu velkho bicha- 30. tyden tehotenstv - a naeho momentlnho \r\npobytu v Nmecku ne brigadu se letos urit nedostavm. Eva Koutn-Ratajov\r\n.\r\n----------------Osloveni SMS-----------------\r\n603806048;602225884;607588077;604298874;603329562; \r\n777102730;723411227;604952374;603294629;605229440; 777248528;605456725;774288601;777273679;723213210; 732149597;732500278;607167349;723336151;605828749; 605762407;731376892;603430427;731375389;602244688; 602104977;605169938;602358805;602603906;723008158; 775603905;732963080;604983372;605409402;','Konec Ratajv a dalch',1,3,35);
INSERT INTO board VALUES (71,'2007-09-04 08:53:49','!!!BRIGDA NA UHL!!! a nejen uhl\r\nVkend 14-16.9.2007 je brigda na uhl. Pedejte tuto informaci co nejvce dalm lenm a hlavn se pihlaste. Samozejm se budou dlat i dal drobn prce pro zajitn pichzejc zimn sezony. Hlate se pes internet jako na pobyt nebo pmo Z. Bekovi. \r\n\r\nTme se na vidnou.\r\n','!!!BRIGDA NA UHL!!! a nejen uhl',1,1,35);
