INSERT INTO message VALUES (44,'Udeleni vyznamenani','','U prilezitosti 88. jubilea VRSR udilim s. J.J. Kokockinovi Rad za vystavbu, a to za znamenitou praci v oblasi propagace hnuti mezinarodniho proletariatu!\r\n\r\nPraci cest!','2005-11-07 21:59:14','85.71.39.148','148.39.broadband4.iol.cz',NULL,0,1,NULL,'mjr. Znakov K.P., predseda presidia','predseda prezidia HBS');
INSERT INTO message VALUES (41,'Slavnostn sputn domny SOJUZ.CZ','','Na pokyn nejvyho sovtu HBS byla k vro VSR slavnostn sputna domna WWW.SOJUZ.CZ. Ur, ur, ur!!','2005-11-06 11:52:44','212.80.64.146','etnetera--l3sw2.tgnet.cz',NULL,0,0,NULL,'Jurij Kokockin','zastupce lidu');
INSERT INTO message VALUES (40,'Podekovani',NULL,'Za celou programatorskou sekci chci podekovat plk. ing. Stepanovovi. Nove stranky vynikajici. Jen tak dal. Praci cest!				','2005-10-31 06:37:22','135.12.8.34','hfwcere34.celestica.com',NULL,0,0,NULL,'S.I.Ostrachov','zastupce lidu');
INSERT INTO message VALUES (39,'Proverka cinnosti podrizenych',NULL,'Vidim, ze plk. Ing. Stepanov se opravdu cinil. Pochvala lidu te nemine!				','2005-10-09 16:10:34','85.71.39.148','148.39.broadband4.iol.cz',NULL,0,0,NULL,'mjr. Znakov K.P.','zastupce lidu');
INSERT INTO message VALUES (38,'Navstevni kniha',NULL,'Timto slavnostn spoutme guestbook!!!\r\n\r\nUraaa, Uraaa, Uraaa.\r\n\r\nVem reakcionm se tak dv na vdomost, e za spam a podobn nepstojnosti bude ihned nsledovat zablokovn IP (Internacionalnove Povyrazenie) ','2005-10-08 16:38:56','212.80.64.146','etnetera--l3sw2.tgnet.cz',NULL,0,1,NULL,'Jurij Kokockin','vedouci kodovaci sekce');
INSERT INTO message VALUES (43,'Udeleni vyznamenani','','U prilezitosti 88. jubilea VRSR udilim s. J.J. Kokockinovi Rad za vystavbu, a to za znamenitou praci v oblasi propagace hnuti mezinarodniho proletariatu!\r\n\r\nPraci cest!','2005-11-07 21:59:09','85.71.39.148','148.39.broadband4.iol.cz',NULL,0,0,NULL,'mjr. Znakov K.P., predseda presidia','zastupce lidu');
INSERT INTO message VALUES (46,' o nai vlast,o vechny kterm je tato zem mil','p1939@atlas.cz','Soudruzi,chyb mi tu v ruskch lidovkch pse,kterou jsme se uili ve kole a kter se mi moc lbila. Zanala njak takhle : Step da step krugom, pust daljok lezit v toj stepi gluchoja zoomeral jamik ................... .Nev zda tato slova jsou pesn ale asi ano .Kdyby se vm podailo  ji najt,byl bych velice rd .\r\n         Dkuji s pozdravem est prci      Zdenk','2005-11-08 05:30:02','85.207.11.98',NULL,NULL,0,1,NULL,'Zdenek  Jank','nestrank ale sympatizant na 100 %');
INSERT INTO message VALUES (47,'o odkaz idel VSR','laaca@seznam.cz','Vborn soudruzi. U jsem myslel, e vs zapadn burousti zahrabali, ale ne. Sovtsk lovk nebo alespo lovk se zkuenostmi ze Sovtskho svazu se nenech zlomit. Jet uvidme kdo koho pohb. Jen tak dl.\r\n????? ?????? ????? ??????, ????? ?????? ????? ??!','2005-11-08 08:18:32','81.0.253.29','abak-ujezd.casablanca.cz',NULL,0,1,NULL,'Laaca','vedouc zootechnik');
INSERT INTO message VALUES (48,'nemohu si dovolit nepodkovat','MKony@seznam.cz','Souputnci, soudruzi! Dkuji Vm za dvru. Nebude zneuita. Tak psahm na:  kov z dl chrabrho kinku Aurora, ki holnek hrdinnch soudruh nmonk a slaninu dukelskch partizn. Hur, hur, hur!!! ','2005-11-08 16:07:14','193.85.70.161','pra9-b161.adsl.dial-up.cz',NULL,0,1,NULL,'Sergej Kukin','nstnk');
INSERT INTO message VALUES (57,'Teba pozvednout aktivitu, soudruzi!!','','Soudruzi teni!\r\n\r\nButo nemte problmy s pravicovmi reakcioni i jste polevili ve svm agitanm sil!!!\r\n\r\n\r\nvyzvm vs k astj publikaci nzor...\r\n\r\nmjr. Znakov, K.P.','2005-11-24 18:32:05','85.71.39.148','148.39.broadband4.iol.cz',NULL,0,1,NULL,'mjr. Znakov K.P.','predseda presidia Nejvyho sovtu');
INSERT INTO message VALUES (56,'test','','test','2005-11-17 20:03:37','212.80.64.146','etnetera--l3sw1-2948.tgnet.cz',NULL,0,0,NULL,'test','');
INSERT INTO message VALUES (58,'pravicov reakcioni','','S mrzkmi pravicovmi reakcioni problmy mm soudruhu. U zkouky jsem si vythl otzku \"deprese\" ,a imperialistick profesor se m zeptal na boje eskoslovenskch legi v SSSR','2005-12-03 12:59:22','81.0.253.29','abak-ujezd.casablanca.cz',NULL,0,1,NULL,'Kukuruza','student marxistick psychiatrie');
INSERT INTO message VALUES (60,'Vice ohlasu, soudruzi','','Soudruzi!\r\n\r\nVedeni hudebni komise postrada zpetnou vazbu pracujicch! \r\n\r\nProto povinn kad navtvnk strnek nech nape, jak se mu lb psn aktuln pidan do archivu, nap. tento msc \"Pse ocele\".\r\n\r\nGromovodov., A.J.','2006-01-19 19:10:38','85.71.39.148','148.39.broadband4.iol.cz',NULL,0,1,NULL,'Gromovodov A.J.','predseda komise pro doplnovani hudebniho archivu');
